import React from "react";
import { Row, Card, Col, Button, Nav } from "react-bootstrap";
import { Link, useHistory } from "react-router-dom";
import { Image } from "cloudinary-react";
export default function Categories({ category }) {
  const navigate = useHistory();
  const updateCategory = () => {
    let path = `/CreateCategory/${category._id}`;

    navigate.push(path);
  };
  return (
    <>
      <Row>
        <Col lg="12" xl="6">
          <Card>
            <Card.Body>
              <Row>
                <Col md="5" xl="3">
                  <div class="new-arrival-product mb-xxl-4 mb-md-0 mb-4">
                    <div class="new-arrivals-img-contnent">
                      <Image cloudName="djpdvrlkk" publicId={category.image} />
                    </div>
                  </div>
                </Col>
                <Col md="7" xl="12">
                  <Link to={`/ecom-product-detail/${category._id}`}>
                    {category.name}
                  </Link>
                  <Button
                    className="me-2"
                    variant="danger btn-rounded"
                    // onClick={() => {
                    //   seti((prev) => prev + 2);
                    //   console.log(a);
                    //   deleteP(category._id);
                    // }}
                  >
                    Remove
                  </Button>
                  <Button
                    className="me-2"
                    variant="success"
                    onClick={updateCategory}
                  >
                    Update
                  </Button>
                </Col>
              </Row>
            </Card.Body>
          </Card>
        </Col>
      </Row>
    </>
  );
}
